import{_ as t,a as o,b as r}from"./chunks/projets-recents.Df9p5DMm.js";import{_ as a,o as i,c as l,ag as s}from"./chunks/framework.Dm0CChhA.js";const _=JSON.parse('{"title":"Guide: Project Launch","description":"","frontmatter":{},"headers":[],"relativePath":"guide-launch.md","filePath":"guide-launch.md"}'),n={name:"guide-launch.md"};function c(d,e,h,u,p,m){return i(),l("div",null,[...e[0]||(e[0]=[s('<h1 id="guide-project-launch" tabindex="-1">Guide: Project Launch <a class="header-anchor" href="#guide-project-launch" aria-label="Permalink to &quot;Guide: Project Launch&quot;">​</a></h1><p>There are three different ways to launch a project in RhythmNator Editor. This guide explains how to use each of them.</p><hr><h2 id="_1-create-a-new-project" tabindex="-1">1. Create a New Project <a class="header-anchor" href="#_1-create-a-new-project" aria-label="Permalink to &quot;1. Create a New Project&quot;">​</a></h2><p>The most common method to start a new sheet.</p><ol><li>Click the <strong>&quot;New Project&quot;</strong> button.</li><li>Fill in the three fields in the form: <ul><li><strong>Project Name</strong>: The title of your creation.</li><li><strong>Folder</strong>: The save location on your computer.</li><li><strong>Music</strong> (Optional): The audio file to map.</li></ul></li><li>Click <strong>&quot;Create&quot;</strong> to launch the editor.</li></ol><video controls width="100%" style="border-radius:8px;margin:20px 0;"><source src="'+t+'" type="video/mp4"> Your browser does not support video playback. </video><hr><h2 id="_2-open-an-existing-project" tabindex="-1">2. Open an Existing Project <a class="header-anchor" href="#_2-open-an-existing-project" aria-label="Permalink to &quot;2. Open an Existing Project&quot;">​</a></h2><p>If you already have a project file on your disk.</p><ol><li>Click the <strong>&quot;Open a Project&quot;</strong> button located just below the first button.</li><li>Navigate your folders via the system dialog.</li><li>Select your file with the <strong><code>.rne</code></strong> extension.</li><li>The project will load and open automatically.</li></ol><video controls width="100%" style="border-radius:8px;margin:20px 0;"><source src="'+o+'" type="video/mp4"> Your browser does not support video playback. </video><hr><h2 id="_3-use-the-recent-projects-list" tabindex="-1">3. Use the Recent Projects List <a class="header-anchor" href="#_3-use-the-recent-projects-list" aria-label="Permalink to &quot;3. Use the Recent Projects List&quot;">​</a></h2><p>To quickly pick up where you left off.</p><ol><li>Check the <strong>Recent Projects</strong> list on the home screen.</li><li>Click directly on the card of the project you recently worked on.</li><li>The editor will open immediately with that project.</li></ol><video controls width="100%" style="border-radius:8px;margin:20px 0;"><source src="'+r+'" type="video/mp4"> Your browser does not support video playback. </video><hr><h2 id="file-format" tabindex="-1">File Format <a class="header-anchor" href="#file-format" aria-label="Permalink to &quot;File Format&quot;">​</a></h2><p>Projects are saved in <strong><code>.rne</code></strong> format. These are lightweight JSON-based files that store note positions and metadata. Always use <code>Ctrl+S</code> in the editor to manually save your progress.</p>',20)])])}const y=a(n,[["render",c]]);export{_ as __pageData,y as default};
